import styled from 'styled-components';

export const Body = styled.div `
    margin: 0;
    padding: 0;
    display: block;
`
export const MainContainer = styled.div `
    height: 100vh;
    margin-top: 100px;
    display: flex;
    justify-content: center;
`

export const GitContainer = styled.div `
    width: 90vw;
    border: 1px solid black;
`
